import React, { useEffect, useState } from "react";
import { getRunners } from "../services/api";

const Home = () => {
  const [runners, setRunners] = useState([]);

  useEffect(() => {
    getRunners()
      .then((response) => setRunners(response.data))
      .catch((error) => console.error("Erro ao buscar corredores:", error));
  }, []);

  return (
    <div>
      <h1>Corredores</h1>
      <ul>
        {runners.map((runner) => (
          <li key={runner.email}>{runner.name} - {runner.email}</li>
        ))}
      </ul>
    </div>
  );
};

export default Home;
